									<div class="author-description">
						Scott M. Reid is a sports enterprise/investigative reporter for the Orange County Register. He also covers Olympic and international sports as well as the Los Angelesâ€™ bid to host the 2024 Olympic Games. His work for the Register has led to investigations by the International Olympic Committee, the U.S. Department of Education, the California Legislature, and the national governing bodies for gymnastics and swimming. Reid's 2011 reporting on wide spread sexual abuse within USA Gymnastics and the governing body's failure to effectively address it led to Don Peters, coach of the 1984 record-setting Olympic team, being banned from the sport for life. His reporting also prompted USA Gymnastics to adopt new guidelines and policies dealing with sexual abuse. Reid's 2012 and 2013 reporting on sexual abuse within USA Swimming led to the banishment of two top level coaches. Reid has won 11 Associated Press Sports Editors awards for investigative reporting since 1999. He has also been honored by APSE for game writing, and enterprise, news, and beat reporting. He was an Investigative Reporters and Editors award finalist in 2002 and 2003. Prior to joining the Register in 1996, Reid worked for the Atlanta Journal-Constitution and the Dallas Times Herald. He has a B.A. in the History of the Americas from the University of Washington.					</div>
